Input = ""

# Input = "dabAcCaCBAcCcaDA"

from functools import cache

@cache
def CanReact(a, b):
  Difference = ord(a) - ord(b)
  if Difference == 32 or Difference == -32:
    return(True)
  return(False)

while True:
  Breakout = True
  for Index in range(len(Input) - 1):
    if CanReact(Input[Index], Input[Index + 1]):
      Breakout = False
      Input = Input[:Index] + Input[Index + 2:]
      break
  if Breakout:
      break

  print(len(Input))